// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract GasEfficientVoting{

    uint8 public proposalCount;
    struct Proposal{
        bytes32 name;
        uint32 voteCount;
        uint32 startTime;
        uint32 endTime;
        bool excuted;
    }

    mapping(uint8 => Proposal) public proposals;
    mapping(address => uint256) private voterRegistry;
    mapping(uint8 => uint32) public proposalVoterCount;

    event ProposalCreated(uint8 indexed proposalId, bytes32 name);
    event Voted(address indexed voter, uint8 indexed proposalId);
    event ProposalExcuted(uint8 indexed proposalId);

    function createProposal(bytes32 _name, uint32 duration) external{
        require(duration > 0, "Durations should be more than 0");
        uint8 proposalId = proposalCount;
        proposalCount++;
        Proposal memory newProposal = Proposal({
            name: _name,
            voteCount: 0,
            startTime: uint32(block.timestamp),
            endTime: uint32(block.timestamp) + duration,
            excuted: false
    
        });
        proposals[proposalId] = newProposal;
        emit ProposalCreated(proposalId, _name);

    }

    function vote(uint8 proposalId) external{
        require(proposalId < proposalCount, "Invalid proposal");
        uint256 currentTime = uint32(block.timestamp);
        require(currentTime >= proposals[proposalId].startTime, "Voting has not started");
        require(currentTime <= proposals[proposalId].endTime, "Voting has ended");

        uint256 voterData = voterRegistry[msg.sender];
        uint256 mask = 1 << proposalId;
        require(voterRegistry[msg.sender] == 0, "Already voted");
        voterRegistry[msg.sender] = voterData | mask;
        proposals[proposalId].voteCount++;
        proposalVoterCount[proposalId]++;
        emit Voted(msg.sender, proposalId);



    }

    function excuteProposal(uint8 proposalId) external{
        require(proposalId < proposalCount, "Invalid Proposal");
        require(block.timestamp > proposals[proposalId].endTime, "Voting not ended");
        require(!proposals[proposalId].excuted, "Already excuted");
        proposals[proposalId].excuted = true;
        emit ProposalExcuted(proposalId);
    }

    function hasVoted(address voter, uint8 proposalId) external view returns(bool){
        return(voterRegistry[voter] & (1 << proposalId) != 0);
    }

    function getProposal(uint8 proposalId) external view returns(
        bytes32 name,
        uint32 voteCount,
        uint32 startTime,
        uint32 endTime,
        bool excuted,
        bool active
    )
    {

    require(proposalId < proposalCount, "Invalid proposal");

    Proposal storage proposal = proposals[proposalId];
    return(
        proposal.name,
        proposal.voteCount,
        proposal.startTime,
        proposal.endTime,
        proposal.excuted,
        (block.timestamp >= proposal.startTime && block.timestamp <= proposal.endTime)

    );
    }
}

